import React, { useState } from "react";
import { FormControl, NativeSelect } from "@material-ui/core";

function Dropdown() {
  const [country, setCountry] = useState(["Somalia", "Kenya"]);

  return (
    <FormControl>
      <NativeSelect></NativeSelect>
    </FormControl>
  );
}

export default Dropdown;
